ectures)\nxcodebuild -target \"${TARGET_NAME}\" -configuration Release\n\n# Copy the device version of framework to destination\nmkdir \"${SRCROOT}/frameworks/macOS\"\ncp -R \"${SRCROOT}/build/Release/${FRAMEWORK_NAME}.framework\" \"${SRCROOT}/frameworks/macOS/${FRAMEWORK_NAME}.framework\"\ncp -R \"${SRCROOT}/build/Release/${FRAMEWORK_NAME}.framework.dSYM\" \"${SRCROOT}/frameworks/macOS/\"\n\n\n# === tvOS ===\nTARGET_NAME=\"ASEnterprise tvOS Framework\"\n\n# Build the framework for device and for simulator (using all needed architectures)\nxcodebuild -target \"${TARGET_NAME}\" -configuration Release -arch arm64 -sdk \"appletvos\"\nxcodebuild -target \"${TARGET_NAME}\" -configuration Release -arch x86_64 -sdk \"appletvsimulator\"\n\n# Copy the device version of framework to destination\nmkdir \"${SRCROOT}/frameworks/tvOS\"\ncp -L -R \"${SRCROOT}/build/Release-appletvos/${FRAMEWORK_NAME}.framework\" \"${SRCROOT}/frameworks/tvOS/${FRAMEWORK_NAME}.framework\"\ncp -R \"${SRCROOT}/build/Release-appletvos/${FRAMEWORK_NAME}.framework.dSYM\" \"${SRCROOT}/frameworks/tvOS/\"\n\n# Merge framework executables and dSYMs\nlipo -create -output \"${SRCROOT}/frameworks/tvOS/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \"${SRCROOT}/build/Release-appletvos/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \"${SRCROOT}/build/Release-appletvsimulator/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\"\n\nlipo -create -output \"${SRCROOT}/frameworks/tvOS/${FRAMEWORK_NAME}.framework.dSYM/Contents/Resources/DWARF/${FRAMEWORK_NAME}\" \"${SRCROOT}/build/Release-appletvos/${FRAMEWORK_NAME}.framework.dSYM/Contents/Resources/DWARF/${FRAMEWORK_NAME}\" \"${SRCROOT}/build/Release-appletvsimulator/${FRAMEWORK_NAME}.framework.dSYM/Contents/Resources/DWARF/${FRAMEWORK_NAME}\"\n\n\n# === watchOS ===\nTARGET_NAME=\"ASEnterprise watchOS Framework\"\n\n# Build the framework for device and for simulator (using all needed architectures)\nxcodebuild -target \"${TARGET_NAME}\" -configuration Release -arch armv7k